import { useState } from "react";
import { userdata } from "./user";

const [query,setquery] = useState('')
export function Showdataintable()
{
    userdata.filter((i)=>i.name.includes(query)).map((i)=>(<li>{i.name}</li>))
    return(
        <>
        <button>Search</button>
        <input type="text" value={query} onchange={(e)=>{e.target.value}}/>
        {query}
        </>
    )
}
